import React, { createContext, useContext, useState } from 'react';

const TetContext = createContext();

export const TetProvider = ({ children }) => {
  const [isTetEnabled, setIsTetEnabled] = useState(true);

  return (
    <TetContext.Provider value={{ isTetEnabled, setIsTetEnabled }}>
      {children}
    </TetContext.Provider>
  );
};

export const useTet = () => useContext(TetContext);
